import React from 'react';
import './HomeVlog.css'

const HomeVlog = () => {
  return (
    <div className='vlog'>

      <div className='vlog-wrapper'>
        <div className='vlog-heading'>
           <h1>Recent V-Logs</h1>
           <p>One day at a time</p>
        </div>
        <div className='vlog-email'>
          <input  placeholder='Enter your email address...'/>
          <button>Enter</button>
        </div>


      </div>

    </div>
  );
}

export default HomeVlog;
